import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';
import { faLinkedin, faGithub } from '@fortawesome/free-brands-svg-icons';
import Tooltip from './Tooltip'; // Import Tooltip component (you need to create this)

export default function Contact() {
  return (
    <div className="bg-base-100 about py-20 px-36 flex flex-col items-center">
      {/* Title */}
      <h1 className="text-5xl font-bold p-2 mb-10 rounded-lg inline-block bg-accent">
        Contact Me
      </h1>
      <p className="text-2xl">Feel free to contact or connect with me! </p>
      <div className="flex items-center mt-4">
        {/* Email icon with tooltip */}
        <div className="tooltip tooltip-open tooltip-right" data-tip="hello">
          <FontAwesomeIcon icon={faEnvelope} className="text-3xl mr-4" />
        </div>
        <a href="mailto:your.email@example.com" className="text-xl">your.email@example.com</a>
      </div>
      <div className="flex items-center mt-4">
        {/* LinkedIn icon with tooltip */}
        <div className="tooltip tooltip-open tooltip-right" data-tip="hello">
          <FontAwesomeIcon icon={faLinkedin} className="text-3xl mr-4" />
        </div>
        <a href="https://www.linkedin.com/in/your-linkedin-profile" className="text-xl">LinkedIn Profile</a>
      </div>
      <div className="flex items-center mt-4">
        {/* GitHub icon with tooltip */}
        <div className="tooltip tooltip-open tooltip-right" data-tip="hello">
          <FontAwesomeIcon icon={faGithub} className="text-3xl mr-4" />
        </div>
        <a href="https://github.com/your-github-username" className="text-xl">GitHub Profile</a>
      </div>
    </div>
  );
}
